import React from "react";

import Tile from "../tile/Tile.js";

export const TileList = ({ tiles }) => {



  return (
    <div>
      {tiles.ma((tile, index) => {
        const {name, ...description} = tile;
       return <Tile 
          key={index} 
          name={name} 
          description={description} 
          /> 
      })}
    </div>
  );
};
